(function () {
    const initTooltips = () => {
        const prefersTouch = window.matchMedia('(hover: none)').matches;
        const tooltipTriggerList = Array.from(document.querySelectorAll('[data-bs-toggle="tooltip"]'));

        tooltipTriggerList.forEach((triggerEl) => {
            const tooltip = new bootstrap.Tooltip(triggerEl, {
                trigger: prefersTouch ? 'manual' : 'hover focus',
                boundary: document.body
            });

            triggerEl.addEventListener('keydown', (event) => {
                if (event.key === 'Enter' || event.key === ' ') {
                    event.preventDefault();
                    tooltip.toggle();
                }
            });

            if (prefersTouch) {
                triggerEl.addEventListener('click', (event) => {
                    event.preventDefault();
                    event.stopPropagation();
                    tooltip.toggle();
                });
            }
        });

        if (prefersTouch) {
            document.addEventListener('click', (event) => {
                tooltipTriggerList.forEach((triggerEl) => {
                    const tooltipInstance = bootstrap.Tooltip.getInstance(triggerEl);
                    if (!tooltipInstance) {
                        return;
                    }

                    const tip = tooltipInstance.tip || (typeof tooltipInstance.getTipElement === 'function' ? tooltipInstance.getTipElement() : null);

                    if (triggerEl.contains(event.target)) {
                        return;
                    }

                    if (tip && tip.contains && tip.contains(event.target)) {
                        return;
                    }

                    tooltipInstance.hide();
                });
            });
        }
    };

    const initFieldHighlight = () => {
        document.querySelectorAll('.immigration-field .form-control, .immigration-field .form-select').forEach((input) => {
            const parent = input.closest('.immigration-field');
            if (!parent) return;

            input.addEventListener('focus', () => parent.classList.add('is-focused'));
            input.addEventListener('blur', () => parent.classList.remove('is-focused'));
        });
    };

    const initScrollButtons = () => {
        document.querySelectorAll('[data-scroll-target]').forEach((button) => {
            button.addEventListener('click', (event) => {
                const targetId = button.getAttribute('data-scroll-target');
                if (!targetId) return;
                const target = document.getElementById(targetId);
                if (!target) return;

                event.preventDefault();
                target.scrollIntoView({ behavior: 'smooth', block: 'start' });
            });
        });
    };

    const initProgress = () => {
        const fields = Array.from(document.querySelectorAll('.immigration-field .form-control, .immigration-field .form-select'));
        const progressEl = document.querySelector('[data-form-progress]');
        if (!progressEl || !fields.length) return;

        const updateProgress = () => {
            const filled = fields.filter((field) => {
                if (field.type === 'checkbox') {
                    return field.checked;
                }
                return Boolean(field.value);
            }).length;
            const percent = Math.min(100, Math.round((filled / fields.length) * 100));
            progressEl.style.setProperty('--progress', `${percent}%`);
            progressEl.setAttribute('data-progress-label', `${percent}% تکمیل شد`);
        };

        fields.forEach((field) => field.addEventListener('input', updateProgress));
        updateProgress();
    };

    const initScoreChart = () => {
        const rings = document.querySelector('[data-score-rings]');
        if (!rings) return;

        rings.querySelectorAll('.ring-card').forEach((card) => {
            const score = Number(card.dataset.score || 0);
            const clamped = Math.max(0, Math.min(100, Math.round(score)));
            const progress = card.querySelector('[data-ring-progress]');
            const label = card.querySelector('.ring-value');
            const radius = 58;
            const circumference = 2 * Math.PI * radius;

            if (progress) {
                progress.style.strokeDasharray = `${circumference}`;
                progress.style.strokeDashoffset = `${circumference}`;

                requestAnimationFrame(() => {
                    const offset = circumference - (clamped / 100) * circumference;
                    progress.style.strokeDashoffset = `${offset}`;
                });
            }

            if (label) {
                label.textContent = `${clamped}%`;
            }
        });
    };

    const loadJsPdf = (() => {
        let loader;
        return async () => {
            if (loader) return loader;
            if (window.jspdf?.jsPDF || window.jsPDF) {
                loader = Promise.resolve(window.jspdf?.jsPDF || window.jsPDF);
                return loader;
            }

            loader = new Promise((resolve, reject) => {
                const script = document.createElement('script');
                script.src = 'https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js';
                script.async = true;
                script.onload = () => resolve(window.jspdf?.jsPDF || window.jsPDF);
                script.onerror = () => reject(new Error('jsPDF failed to load'));
                document.head.appendChild(script);
            });

            return loader;
        };
    })();

    const vazirFontBase64 = '';
    let isVazirFontLoaded = false;

    const ensurePdfFont = (doc) => {
        if (!doc) return;

        if (!isVazirFontLoaded) {
            doc.addFileToVFS('Vazir.ttf', vazirFontBase64);
            doc.addFont('Vazir.ttf', 'Vazir', 'normal');
            isVazirFontLoaded = true;
        }

        doc.setFont('Vazir');
    };


    const drawPersonIcon = (doc, x, y, scale = 1, colors = { fill: '#eef2ff', stroke: '#c7d2fe', accent: '#818cf8' }) => {
        doc.setDrawColor(colors.stroke);
        doc.setFillColor(colors.fill);
        doc.circle(x + 12 * scale, y + 10 * scale, 8 * scale, 'FD');

        doc.roundedRect(x + 4 * scale, y + 18 * scale, 16 * scale, 14 * scale, 6 * scale, 6 * scale, 'FD');
        doc.roundedRect(x + 2 * scale, y + 30 * scale, 20 * scale, 16 * scale, 6 * scale, 6 * scale, 'FD');

        doc.setFillColor(colors.accent);
        doc.circle(x + 20 * scale, y + 14 * scale, 3 * scale, 'F');
    };

    const drawPdfHeader = (doc, { pageWidth, margin, averageScore, generatedAt, headerHeight }) => {
        const bandHeight = headerHeight - 26;

        doc.setFillColor(79, 70, 229);
        doc.rect(0, 0, pageWidth, bandHeight, 'F');

        doc.setFillColor(99, 102, 241);
        doc.roundedRect(margin, bandHeight - 32, pageWidth - margin * 2, 42, 14, 14, 'F');

        drawPersonIcon(doc, margin + 8, margin + 10, 1.35, {
            fill: '#ede9fe',
            stroke: '#c7d2fe',
            accent: '#fff'
        });

        doc.setTextColor(255, 255, 255);
        doc.setFontSize(19);
        doc.setFont(doc.getFont().fontName, 'bold');
        doc.text('گزارش خلاصه مهاجرت', pageWidth - margin, margin + 18, { align: 'right' });

        doc.setTextColor(226, 232, 240);
        doc.setFontSize(11);
        doc.text('نتیجه بر اساس آخرین پاسخ‌های شما تهیه شد. برای اشتراک یا چاپ از این نسخه استفاده کن', pageWidth - margin, margin + 38, { align: 'right' });

        doc.setTextColor(224, 231, 255);
        doc.setFontSize(12);
        doc.text(`میانگین کل: ${averageScore}%`, pageWidth - margin, margin + 60, { align: 'right' });
        doc.setFontSize(11);
        doc.text(`تاریخ تولید: ${generatedAt}`, pageWidth - margin, margin + 76, { align: 'right' });

        doc.setFillColor(255, 255, 255);
        doc.roundedRect(pageWidth - margin - 170, bandHeight - 30, 170, 34, 12, 12, 'F');
        doc.setTextColor(79, 70, 229);
        doc.setFontSize(11);
        doc.text('آماده‌ی اشتراک و چاپ', pageWidth - margin - 16, bandHeight - 10, { align: 'right' });

        doc.setFillColor(14, 165, 233);
        doc.circle(pageWidth - margin - 16, bandHeight - 22, 5, 'F');
    };

    const drawPdfFooter = (doc, { pageWidth, pageHeight, margin, footerHeight, pageNumber }) => {
        const footerTop = pageHeight - footerHeight;
        doc.setFillColor(248, 250, 252);
        doc.rect(0, footerTop, pageWidth, footerHeight, 'F');

        doc.setDrawColor(226, 232, 240);
        doc.line(margin, footerTop + 12, pageWidth - margin, footerTop + 12);

        doc.setTextColor(99, 102, 241);
        doc.setFontSize(11);
        doc.text('chamedoon.ir', pageWidth - margin, footerTop + 30, { align: 'right' });

        doc.setTextColor(71, 85, 105);
        doc.setFontSize(10);
        doc.text('این گزارش توسط چمدون ساخته شد. نسخه چاپی برای ارائه رسمی نگه‌داری شود.', pageWidth - margin, footerTop + 48, { align: 'right' });

        drawPersonIcon(doc, margin - 2, footerTop + 16, 1.1, {
            fill: '#e0f2fe',
            stroke: '#bae6fd',
            accent: '#0ea5e9'
        });

        doc.setTextColor(148, 163, 184);
        doc.text(`صفحه ${pageNumber}`, margin + 32, footerTop + 42);
    };

    const createRingImage = (score, accent = '#6366f1') => {
        const clamped = Math.max(0, Math.min(100, Number(score) || 0));
        const size = 190;
        const radius = 62;
        const center = size / 2;
        const canvas = document.createElement('canvas');
        canvas.width = size;
        canvas.height = size;

        const ctx = canvas.getContext('2d');
        if (!ctx) return '';

        ctx.translate(center, center);
        ctx.save();

        ctx.beginPath();
        ctx.arc(0, 0, radius, 0, Math.PI * 2);
        ctx.strokeStyle = 'rgba(148, 163, 184, 0.25)';
        ctx.lineWidth = 12;
        ctx.stroke();

        const startAngle = -Math.PI / 2;
        const endAngle = startAngle + (Math.PI * 2 * clamped) / 100;
        const gradient = ctx.createLinearGradient(-radius, -radius, radius, radius);
        gradient.addColorStop(0, accent);
        gradient.addColorStop(1, '#a5b4fc');

        ctx.beginPath();
        ctx.arc(0, 0, radius, startAngle, endAngle);
        ctx.strokeStyle = gradient;
        ctx.lineWidth = 12;
        ctx.lineCap = 'round';
        ctx.stroke();

        ctx.font = 'bold 22px Inter, Vazirmatn, sans-serif';
        ctx.fillStyle = accent;
        ctx.textAlign = 'center';
        ctx.fillText(`${clamped}%`, 0, 6);

        ctx.font = '15px Inter, Vazirmatn, sans-serif';
        ctx.fillStyle = '#475569';
        ctx.fillText('امتیاز', 0, 28);

        ctx.restore();
        return canvas.toDataURL('image/png');
    };

    const initPdfDownload = () => {
        const downloadButton = document.querySelector('[data-download-pdf]');
        const exportNode = document.getElementById('immigration-export-data');
        if (!downloadButton || !exportNode) return;

        const averageScore = Number(exportNode.dataset.average || 0);
        let exportData = [];

        try {
            exportData = JSON.parse(exportNode.textContent || '[]');
        } catch (error) {
            console.error('Failed to parse export data', error);
        }

        const accentPalette = ['#6366f1', '#0ea5e9', '#8b5cf6', '#10b981'];

        downloadButton.addEventListener('click', async () => {
            const originalText = downloadButton.textContent;
            downloadButton.disabled = true;
            downloadButton.textContent = 'در حال ساخت PDF...';

            try {
                const jsPDF = await loadJsPdf();
                const doc = new jsPDF({ orientation: 'p', unit: 'pt', format: 'a4' });
                ensurePdfFont(doc);
                const pageWidth = doc.internal.pageSize.getWidth();
                const pageHeight = doc.internal.pageSize.getHeight();
                const margin = 36;
                const contentWidth = pageWidth - margin * 2;
                const headerHeight = 168;
                const footerHeight = 72;

                const generatedAt = new Date().toLocaleDateString('fa-IR');

                const renderPageChrome = (pageNumber) => {
                    drawPdfHeader(doc, { pageWidth, margin, averageScore, generatedAt, headerHeight });
                    drawPdfFooter(doc, { pageWidth, pageHeight, margin, footerHeight, pageNumber });
                    return margin + headerHeight + 16;
                };

                let pageNumber = 1;
                let cursorY = renderPageChrome(pageNumber);

                const cardsPerRow = 2;
                const gap = 14;
                const cardWidth = (contentWidth - gap) / cardsPerRow;
                const cardHeight = 198;
                const contentBottom = () => pageHeight - footerHeight - margin;

                let row = 0;
                exportData.forEach((item, index) => {
                    const col = index % cardsPerRow;
                    if (col === 0 && index > 0) {
                        row += 1;
                    }

                    let cardY = cursorY + row * (cardHeight + 16);
                    if (cardY + cardHeight > contentBottom()) {
                        doc.addPage();
                        pageNumber += 1;
                        cursorY = renderPageChrome(pageNumber);
                        row = 0;
                        cardY = cursorY;
                    }

                    const cardX = margin + (cardWidth + gap) * col;

                    const accent = accentPalette[index % accentPalette.length];
                    const ringImage = createRingImage(item.score, accent);

                    doc.setFillColor(255, 255, 255);
                    doc.setDrawColor(226, 232, 240);
                    doc.roundedRect(cardX, cardY, cardWidth, cardHeight, 12, 12, 'FD');

                    doc.setTextColor(99, 102, 241);
                    doc.setFontSize(10);
                    doc.text(`#${index + 1}`, cardX + cardWidth - 14, cardY + 18, { align: 'right' });

                    doc.setTextColor(15, 23, 42);
                    doc.setFontSize(13);
                    doc.text(item.country || 'نامشخص', cardX + cardWidth - 14, cardY + 36, { align: 'right' });

                    doc.setTextColor(71, 85, 105);
                    doc.setFontSize(11);
                    doc.text(item.visa || 'ویزای پیشنهادی', cardX + cardWidth - 14, cardY + 52, { align: 'right' });

                    if (ringImage) {
                        doc.addImage(ringImage, 'PNG', cardX + 18, cardY + 26, 90, 90);
                    }

                    doc.setTextColor(31, 41, 55);
                    doc.setFontSize(10);
                    const detailX = cardX + cardWidth - 16;
                    const detailWidth = cardWidth - 124;
                    const detailStartY = cardY + 86;
                    const detailGap = 16;

                    const drawDetail = (label, value, offset) => {
                        const content = `${label}: ${value || '-'}`;
                        const lines = doc.splitTextToSize(content, detailWidth);
                        doc.text(lines, detailX, detailStartY + offset, { align: 'right' });
                        return lines.length * 12;
                    };

                    let used = drawDetail('شخصیت', item.personality, 0);
                    used += drawDetail('کار', item.job, used + detailGap - 12);
                    used += drawDetail('تحصیل', item.education, used + detailGap - 12);
                    drawDetail('اقتصاد', item.economy, used + detailGap - 12);
                });

                doc.save('immigration-report.pdf');
            } catch (error) {
                console.error('PDF generation failed', error);
            } finally {
                downloadButton.disabled = false;
                downloadButton.textContent = originalText;
            }
        });
    };

    const init = () => {
        initTooltips();
        initFieldHighlight();
        initScrollButtons();
        initProgress();
        initScoreChart();
        initPdfDownload();
    };

    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', init, { once: true });
    } else {
        init();
    }
})();
